import React from "react";
import NavBar from "./NavBar";

const Courses = () => {
  return (
    <div className="">
      <NavBar />
      <div className="p-20 text-white ">
        <h1 className="text-4xl font-semibold">Computer Science</h1>
        <div style={{ backgroundColor: "#292D2B" }} className="p-4 mt-10 mr-10 w-1/4 rounded-md" >
            <h4 className="text-2xl ml-4 mt-">Operating Systems</h4>
        </div>
      </div>
    </div>
  );
};

export default Courses;
